import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

import { Container } from './styles';

const Pets: React.FC = () => {


    interface Pet {
        name?: string;
        specie?: string;
        age?: string;
        description?: string; 
        image: string;
        userId?: string;
      };


    interface PetParams {
        category: string;
      }

      const params = useParams<PetParams>();
      const [pets, setPets] = useState<Pet>();

      useEffect(() => {

        fetch("http://localhost:8080/api/pets/category?category=" + params.category)
        .then((response) => response.json())
        .then((response) => {
            setPets(response.results);
        })

      }, [params.category]) 


  return (
    <Container>

    </Container>
  );
}

export default Pets;
